window.regionalizaGeoIP = function() {

    var urlGeoip = 'http://api.vivogeolocalizacao.clientes.ananke.com.br/api/geolocation';

    $('#currentCity').text('Localizando...');

    $.ajax({
        url: urlGeoip,
        type: "post",
        dataType: "json",
        timeout: 4000,
        success: function(data) {
            if (data.City != '') {
                locatedByGeoIp = true;
                searchDataCity('geoip-success', data.City)
            } else {
                if (navigator.geolocation) {
                    navigator.geolocation.getCurrentPosition(geolocationPosition, function(error) {
                        showBussola('abriuBussola', locatedByGeoIp, null, null, null, true, false, false)
                    }, {
                        timeout: 2000
                    });
                } else {
                    showBussola('abriuBussola', false, null, null, null, true, false, false);
                }
            }
        },
        error: function(error) {
            console.error('Error occurred. Error code: ' + error.code);
            if (navigator.geolocation) {
                navigator.geolocation.getCurrentPosition(geolocationPosition, function(error) {
                    showBussola('abriuBussola', locatedByGeoIp, null, null, null, true, false, false)
                }, {
                    timeout: 2000
                });
            } else {
                showBussola();
            }
        }
    });

}

function geolocationPosition(currentPosition) {
    var lat = currentPosition.coords.latitude;
    var lng = currentPosition.coords.longitude;
    var key = 'gme-telefonicabrasil1';
    var url = 'https://maps.googleapis.com/maps/api/geocode/json?latlng='

    $.ajax({
        url: url + lat + ',' + lng + '&Key' + key,
        type: "get",
        dataType: "json",
        success: function(data) {

            try {
                var results = data.results;
                for (i = 0; i < results.length; i++) {
                    var types = results[i].types
                    for (j = 0; j < types.length; j++) {
                        if (types[j] == 'locality') {
                            searchDataCity('geolocation-success', results[i].address_components[0].long_name);
                            locatedByGeoIp = true;
                            break;
                        }
                    }
                }
            } catch (e) {
                showBussola('abriuBussola', locatedByGeoIp, null, null, null, true, false, false)
            }
        },
        error: function(data) {
            showBussola('abriuBussola', locatedByGeoIp, null, null, null, true, false, false)
        }
    })
}

