function configAutocomplete() {
    var _formatRegexp = function(q) {
        q = q.replace(/[eéèêëEÉÈÊË]/gi, '[eéèêëEÉÈÊË]');
        q = q.replace(/[aàáãâäAÀÁÂÃÄÅÆ]/gi, '[aàáãâäAÀÁÂÃÄÅÆ]');
        q = q.replace(/[cçC]/gi, '[cçC]');
        q = q.replace(/[iíìïîIÌÍÎÏ]/gi, '[iíìïîIÌÍÎÏ]');
        q = q.replace(/[oóòôöÒÓÔÕÖ]/gi, '[oóòôöÒÓÔÕÖ]');
        q = q.replace(/[uúùüûUÜÛÙÚ]/gi, '[uúùüûUÜÛÙÚ]');
        q = q.replace(/[yYÿÝ]/gi, '[yYÿÝ]');
        return q;
    };

    var _inputComplete = document.getElementById("autocomplete");
    var awesomplete = new Awesomplete(_inputComplete, {
        minChars: 2,
        maxItems: 4,
        filter: function(data, input) {
            return _formatRegexp(data).toLowerCase().indexOf(_formatRegexp(input).toLowerCase()) > -1
        }
    });

    var listComplete = [];
    $.each(window.cidades, function(key, item) {
        listComplete.push(item.value);
    });

    awesomplete.list = listComplete;


    window.addEventListener("awesomplete-select", function(e) {
        removeErrorBussola();
        $('.error-select').hide();
    });

    window.addEventListener("awesomplete-selectcomplete", function(e) {
        var id = listComplete.indexOf(e.text.label);
        var estado = window.cidades[id].data;
        var cidade = window.cidades[id].value;
        var ddd = window.cidades[id].ddd;

        document.activeElement.blur()

        if ($(window).width() < 1023 && $('.controle__header__nav').css('display') == 'block') {
            $('.controle__header__nav').hide();
            $('#bt-menu-mob').removeClass('open');
        }

        if (!window.citySelected) {
            sendDataCityToDB(cidade)
        }

        setCookie(estado, cidade, ddd);
        window.citySelected = true;

    }, false);
}

