function showBussola(event, locatedByGeoIp, estado, cidade, ddd, exibiuBussola, selecionouCidade, escapouBussola) {
    $("#vvpcnvgbuss").fadeIn(100);
    controllScroll('lock');

    sendDataLayerLocation(event, locatedByGeoIp, estado, cidade, ddd, exibiuBussola, selecionouCidade, escapouBussola);
}

function closeBussola(origin, event, locatedByGeoIp, estado, cidade, ddd, exibiuBussola, selecionouCidade, escapouBussola) {
    $("#vvpcnvgbuss").fadeOut(100);
    var offset;
    if (origin == 'returnShop') {
        offset = $(".plans-section").offset().top;
    } else {
        offset = 0;
    }


    $('html, body').animate({
        scrollTop: offset
    }, 500);


    controllScroll('unlock');
    sendDataLayerLocation(event, locatedByGeoIp, estado, cidade, ddd, exibiuBussola, selecionouCidade, escapouBussola)
}


function controllScroll(status) {
    if (status == 'lock') {
        document.ontouchmove = function(event) {
            event.preventDefault();
        }
        $('html').css('overflow', 'hidden');
    } else {
        $('html').css('overflow', 'auto');
        document.ontouchmove = function(event) {

        }
    }
}


